Saturday night at Alma.  A new flavor destination, serving authentic Mexican with Southern California flair.  On the ground floor, ALMA’s walk-up taqueria and marketplace, selling imported Mexican novelties and fresh ingredients.  And on the second floor is ALMA’s fine-dining restaurant serving a wide-array of tasty dishes.  Plus a live band on weekends, feel free to stand up and dance table side! 

Grupo Hunan is a major Mexico City player, Alma is their first United States foray.  They are known for some of Mexico City’s most well-regarded restaurants. 

